//**********************************************************************
// Configuration override for Geo-Person Shuffle
//**********************************************************************
#include<sflAPI>

function getConfigOverride(context) {
  var configOverride = array();
  
  // Add forms here
  configOverride["apiForms"] = {
       'Full Report': 'Full Report',
        'Just Dates': 'Just Dates',
      'Multi Fields': 'Multi Fields',
       'Text Fields': 'Text Fields',
    'Special Fields': 'Special Fields',
     'Header Fields': 'Header Fields',
       'Simple Form': 'Simple Form'
  }
  
  context.response[0] = sflAPI_ComposeResultRow(context, configOverride, null, null, null);
  return context;
}

var apiConfig = array();
apiConfig["get"]    = sflUtilCreateFunctionPointer(getConfigOverride);
apiConfig["put"]    = null;
apiConfig["post"]   = null;
apiConfig["delete"] = null;

return sflAPI_Process(EVENT().Data(), apiConfig);

